/*************Creat view************************/
CREATE VIEW [dbo].[viewClosePriceByTicker]
	AS SELECT ClosePrice, StockTicker FROM (SELECT    ClosePrice, StockTicker, PriceDate, max_date = MAX(PriceDate) OVER(PARTITION BY StockTicker)   FROM[StockPriceByDay]) as s  WHERE  PriceDate = max_date;

